// ImageDisplay.js
import React from 'react';
import './ImageDisplay.css';

const ImageDisplay = ({ firstFrameUrl, selectedQuadrant, onQuadrantClick }) => {
  const handleQuadrantClick = (quadrantIndex) => {
    onQuadrantClick(quadrantIndex);
  };

  return (
    <div className="image-display">
      <div className="grid-container">
        {Array.from({ length: 30 }).map((_, rowIndex) => (
          <div className="grid-row" key={rowIndex}>
            {Array.from({ length: 30 }).map((_, colIndex) => (
              <div
                className={`grid-square ${
                  selectedQuadrant === rowIndex * 30 + colIndex ? 'selected' : ''
                }`}
                key={colIndex}
                onClick={() => handleQuadrantClick(rowIndex * 30 + colIndex)}
              />
            ))}
          </div>
        ))}
      </div>
      <img
        src={firstFrameUrl}
        alt="First Frame"
        className="image"
      />
    </div>
  );
};

export default ImageDisplay;
